import React, { useEffect, useState } from "react";

function Posts() {
    const [posts, setPosts] = useState()

    useEffect(() => {
        fetch("/posts")
        .then((res) => res.json())
        .then((res) => setPosts(res))
    }, [])

    return (
        <h1>{console.log(posts)}</h1>
    )
}

export default Posts;
